function type(t){return typeof t}function int(t,n=10){return parseInt(String(t),n)}function float(t){return parseFloat(String(t))}function str(t){return String(t)}function len(t){return t.length}function range(...t){let n,r,e;1==t.length?[n,r,e]=[0,t[0],1]:2==t.length?[n,r,e]=[t[0],t[1],1]:[n,r,e]=[t[0],t[1],t[2]];let o=[];if(e>0)for(let t=n;t<r;t+=e)o.push(t);else for(let t=r;t>n;t-=e)o.push(t);return o}function round(t,n){return Math.round(t*10**n)/10**n}function chr(t){return String.fromCharCode(t)}function ord(t){return t.charCodeAt(0)}class random{static random(){return Math.random()}static randint(t,n){return Math.ceil(Math.random()*(n-t+1))+t-1}static choice(t){return t[Math.ceil(Math.random()*t.length)-1]}static shuffle(t){let n=!1,r=t.length;"string"==typeof t&&(t=t.split(""),n=!0);let e=[];for(let n=0;n<r;n++)e.push(t.splice(Math.ceil(Math.random()*t.length)-1,1)[0]);return n?e.join(""):e}}String.prototype.join=function(t){return t.join(this)},print=console.log;